import { Route, Routes } from "react-router-dom";
import headerLogo from "../images/headerLogo.svg";

export function Header({email, onCLick, text}) {

    return(
        <header className="header">
        <img className="header__logo" src={headerLogo} alt="Логотип Mesto"/>
        <Routes>
          <Route path="/"
          element={
          <div className="header__text-box">
            <p className="header__text">{email}</p>
            <p onClick={onCLick} className="header__text header__text_button">{text}</p>
          </div> } />
          <Route path="/sign-up"
          element={
            <div className="header__text-box">
              <p onClick={onCLick} className="header__text header__text_button">Войти</p>
            </div>  
          }/>
        </Routes>
      </header>
    );
};

